import React, { useState } from 'react';
import axios from 'axios';
import Login from './Login';

// ===============================
// CONFIG — Your GitHub Codespaces Proxy URL
// ===============================
const PROXY_BASE =
  window.location.hostname === "localhost"
    ? "http://localhost:8000"
    : window.location.origin.replace(":3000", ":8000");

// ===============================
//   Crypto Helpers (old code)
// ===============================

async function importKeyFromRaw(rawKeyBytes) {
  return await window.crypto.subtle.importKey(
    'raw', rawKeyBytes, { name: 'AES-GCM' }, false, ['decrypt']
  );
}

function hexToUint8(hex) {
  return new Uint8Array(hex.match(/.{1,2}/g).map(b => parseInt(b, 16)));
}

async function decryptBlob(rawKeyBytes, nonceHex, ciphertextHex) {
  const key = await importKeyFromRaw(rawKeyBytes);
  const iv = hexToUint8(nonceHex);
  const ct = hexToUint8(ciphertextHex);
  const plain = await window.crypto.subtle.decrypt({ name: 'AES-GCM', iv }, key, ct);
  const dec = new TextDecoder().decode(plain);
  return JSON.parse(dec);
}

// Masking logic from old UI
function maskMetadata(metadata) {
  const m = { ...metadata };
  if (m.age) m.age = "##";
  if (m.name) m.name = "REDACTED";
  return m;
}

// Small helper: decode JWT payload (safe for dev)
function parseJwtPayload(token) {
  try {
    const payloadPart = token.split(".")[1];
    const decoded = atob(payloadPart.replace(/-/g, "+").replace(/_/g, "/"));
    return JSON.parse(decoded);
  } catch {
    return null;
  }
}

// ===============================
//    MAIN UI COMPONENT
// ===============================
export default function App() {
  const [blobs, setBlobs] = useState([]);
  const [keyFile, setKeyFile] = useState(null);
  const [token, setToken] = useState("");
  const [userInfo, setUserInfo] = useState(null); // NEW

  // -------------------------------
  // AUTH HANDLING  (NEW)
  // -------------------------------
  function setAuthToken(t) {
    setToken(t);

    if (t) {
      axios.defaults.headers.common["Authorization"] = "Bearer " + t;
      sessionStorage.setItem("jwt", t);

      const payload = parseJwtPayload(t);
      setUserInfo(payload ? { sub: payload.sub, role: payload.role } : null);
    } else {
      delete axios.defaults.headers.common["Authorization"];
      sessionStorage.removeItem("jwt");
      setUserInfo(null);
    }
  }

  // Load token on startup
  React.useEffect(() => {
    const saved = sessionStorage.getItem("jwt");
    if (saved) setAuthToken(saved);
  }, []);

  // -------------------------------
  //   LOAD BLOBS (with auth)
  // -------------------------------
  async function loadBlobs() {
    try {
      const r = await axios.get(`${PROXY_BASE}/list_blobs`);
      setBlobs(r.data.blobs || []);
    } catch (e) {
      alert("List failed: " + (e.response?.data?.detail || e.message));
    }
  }

  // -------------------------------
  //   DECRYPT SELECTED BLOB
  // -------------------------------
  async function handleDecrypt(filename) {
    if (!keyFile) {
      alert("Upload key file first");
      return;
    }

    const fr = new FileReader();
    fr.onload = async (e) => {
      try {
        const rawKey = new Uint8Array(e.target.result);

        const r = await axios.get(`${PROXY_BASE}/fetch_blob/${filename}`);
        const enc = r.data.enc_blob;

        const decrypted = await decryptBlob(rawKey.buffer, enc.nonce, enc.ciphertext);

        const masked = {
          vector_length: decrypted.vector.length,
          metadata: maskMetadata(decrypted.metadata),
        };

        alert("Decrypted (masked): " + JSON.stringify(masked));
      } catch (err) {
        alert("Decrypt failed: " + (err.response?.data?.detail || err.message));
      }
    };

    fr.readAsArrayBuffer(keyFile);
  }

  // ===============================
  //        UI RENDERING
  // ===============================
  return (
    <div style={{ padding: 20 }}>
      <h2>Clinician UI — Demo (Auth + Local Decrypt)</h2>

      {/* Login Component (NEW) */}
      <Login onToken={setAuthToken} />

      {/* NEW: Show user info */}
      {userInfo ? (
        <div style={{ marginBottom: 12 }}>
          Logged in as: <b>{userInfo.sub}</b> ({userInfo.role})
          <button style={{ marginLeft: 10 }} onClick={() => setAuthToken("")}>
            Logout
          </button>
        </div>
      ) : (
        <div style={{ marginBottom: 12, color: "#777" }}>Not logged in</div>
      )}

      <div style={{ marginBottom: 10 }}>
        <input type="file" onChange={(e) => setKeyFile(e.target.files[0])} />
        <span style={{ marginLeft: 8 }}>
          Upload hospital key to decrypt results locally
        </span>
      </div>

      <div style={{ marginTop: 10 }}>
        <button onClick={loadBlobs}>List Encrypted Blobs</button>
      </div>

      <ul>
        {blobs.map((b) => (
          <li key={b} style={{ marginTop: 8 }}>
            {b}
            <button style={{ marginLeft: 8 }} onClick={() => handleDecrypt(b)}>
              Decrypt locally
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}
